    function yposition(d, i) {
        if (i >= 0 && i < 15) {
            return 80;
        } if (i > 14 && i < 30) {
            return 255;
        } if (i > 29 && i < 45) {
            return 430;
        }
        if (i > 44 && i < 60) {
            return 605;
        }
        else {
            return 750;
        }
    }
    function xposition(d, i) {
        if (i >= 0 && i < 15) {
            return 130 * 1.14 * i + 95;
        } if (i > 14 && i < 30) {
            return 130 * 1.14 * i - 2127;
        }
        if (i > 29 && i < 45) {
            return 130 * 1.14 * i - 4350;
        } if (i > 44 && i < 60) {
            return 130 * 1.14 * i - 6575;
        }
    }
    function groupposition(d, i) {
        let x = xposition(d, i);
        let y = yposition(d, i);
        return "translate(" + x + "," + y + ")";
    }

